import './App.css';
import Navbar from './components/Navbar'; 
import Home from './components/Home';
import About from './components/About';
import { Routes, Route } from 'react-router-dom';



function App() {
  return (
    <div >
       <Navbar />

        <Routes>
          <Route path="/" element = {Home}>

          </Route>
          <Route path="/about" element={About} />

        </Routes>

    </div>
  );
}

export default App;
